INSERT INTO `episode` VALUES (1,'<p>역사학자. 혹은 인류학자들은 지난 2000년간 무슨 일이 벌어졌는지 전혀 알 수 없었다. 지난 2000년의 기록이 아예 없다. 그나마 기록이 남아 있는 것은 최근 200년 가량. 기록이 사라져버린 그 시기를 \'잃어버린 문명.\' 이라고 부른다. 다만 추정하기로, 현재의 기술 수준은 과거 2010년대 후반 수준으로 판명되었다.</p><p><br></p><p>그래서 사람들은 편의상 \'잃어버린 문명\'을 제외하고서 지금을 DC 2016년이라고 표기하고 있다. 작ㅍ무을 작성하게 되느렁라ㅓㄴ아ㅣ러ㅏㅣㄴㅇ러ㅏㅣㄴ어라ㅣㄴ어라ㅣㅓㄴ아ㅣ런아ㅣ러ㅏㅣㄴ어라ㅣㄴ어라ㅣㅓㄴ아ㅣ런아ㅣㅓ라ㅣㄴ어라ㅣㅓㄴ아ㅣ런아ㅣㅓ라ㅣㄴ어라ㅣㅓㄴ아ㅣ런아ㅣㅓ라ㅣㄴ어라ㅣㅓㄴㅇㄹㄴㅇㄹㄴㅇㄹㄴㅇㄹㄴㅇㄹㄴㅇㄹㄴㅇㄹㄴㅇㄹ</p><p><br></p><p>\'잃어버린 문명\' 자체를 부정하는 사람은 없었다. 증거가 뚜렷하게 남아있었으니까. 그 증거는 바로 시스템 \'제우스\'였다. 이 제우스를 누가 어디서 어떻게 만들었는지는 밝혀지지 않았다. 다만 이 \'제우스\'는 서울 여의도에 위치한 커다란 돔 안에 있다고 알려져 있다. 과거, 한국의 국회의사당이 있던 그 자리다. 그 자리는 커다란 돔에 둘러싸여 있으며 그 누구의 발길도 허락하지 않는다고 알려져 있다.</p><p><br></p><p>저 돔이 어떤 물질로 구성되어 있는지, 어떻게 하면 저 돔 안으로 들어갈 수 있는지도 모른다. 내부가 어떻게 생겼는지도 알 수 없다. 다만, 제우스는 실재하고 있는 \'잃어버린 문명의 잔재\'이며 그 잔재는 기록이 다시 시작된 지난 200년 동안, 가상현실게임 올림푸스를 운영하고 있다.</p><p><br></p><p>가상현실게임 올림푸스는 단순히 게임이 아니었다. DC 2016년 현대 문명의 주춧돌이 바로 올림푸스라고 해도 과언이 아니었으니까.</p><p><br></p><p>올림푸스에서는 석유도 구할 수 있다. 더 정확히 말하자면 석유의 역할을 대신하는 \'몬스터 스톤\'이지만, 어쨌거나 그걸 구해서 현실로 전송할 수 있다. 올림푸스의 물건을 현실로. 인류는 이를 통해 발전해왔고 이걸 올림푸스 혁명이라 부른다.</p><p><br></p><p>올림푸스는 현실을 유지하는 하나의 수단이었으며 올림푸스를 지배하는 자가 곧 현실을 지배하는 자가 되었다. 올림푸스의 산물이 이 현대사회를 이끌어갔으니까.</p><p><br></p><p>그래서 모든 사람들이 올림푸스를 지배하고 싶어했다.</p><p><br></p><p>\'니미럴.\'</p><p><br></p><p>한주혁도 그 중 한 명이었다. 불과 10년 전까지는.</p><p><br></p><p>\'저 미친 스승새끼...!\'</p><p><br></p><p>한주혁의 현재나이 26세. 올림푸스에서 첫 걸음을 내딛는 시기가 보통 6살이다. 통상적으로 6살부터 올림푸스에 진입하게 되며 아카데미에 입학하게 된다.</p><p><br></p><p>6살 때. 한주혁은 어느 미친놈에게 납치를 당했다. 그 미친놈이 이렇게 말했었다.</p><p><br></p><p>- 드디어 재능을 가진 아이를 찾았구나. 이런 재능을 가진 아이를 찾다니. 클클클! 천하의 무골이로고! 내 너를 세상에서 가장 강한 사내로 만들어 주겠다!</p><p><br></p><p>그렇게 20년이 흘러버렸다.</p><p><br></p><p>\"이제 나는 죽어도 여한이 없구나. 내 모든 것을 전수했으니.\"</p><p><br></p><p>제발 어서 죽어주세요. 한주혁은 이 미친 작자에게 일말의 동정심도 품지 않았다. 정(情)도 느껴지지 않았다. 지금 집안에서 밥버러지, 만년 취준생 취급을 받고 있는 게 바로 이 미친 스승놈때문 아니겠는가.</p><p><br></p><p>20년간 납치 및 감금, 폭행, 협박, 괴롭힘을 받으며 이 늙은이를 위해 무료봉사를 해왔다. 자신을 납치하여 20년간 괴롭힌 당사자에게 무슨 미련이 남으랴. 몇 번이나 탈출을 시도했다가 정말 죽기 일보직전까지 얻어맞았다. 살아있는 상태로 하이에나들에게 뜯겨먹기도 했다. 그 때만 떠올리면 아직도 소름이 돋는다. 그 기억들이 아직도 생생했다.</p><p><br></p><p>\'그래도 나는 결국 버텼어.\'</p><p><br></p><p>어떻게 버텼는지. 자신이 왜 버텼는지. 그것도 잘 모르겠다. 일반적인 경우라면, 캐릭터 삭제를 하고 다시 키웠을 거다. 그게 당연한 거고 상식이다. 이런 경우를 일컬어 똥통에 빠졌다고 표현하니까. 그런데 한주혁은 그 똥통에서 어찌어찌 살아남았다.</p><p><br></p><p>\"스승님.\"</p><p><br></p><p>그런데 아직 남은 게 좀 있다.</p><p><br></p><p>\"저는 스승님의 아들 같은 존재입니다.\"</p><p><br></p><p>이 더러운 스승에게서 살아남기 위하여 아부 정도는 패시브 스킬이다. 그는 20년간 이렇게 버텼다.</p><p><br></p><p>\"이 아들은 스승님의 비호 없이 험난한 세상을 살아갈 자신이 없습니다.\"</p><p><br></p><p>\"...그렇지 않다. 나보단 많이 약하지만 그래도 많이 강해졌다.\"</p>','2020-05-22 06:03:04.966000','던전을 지어보자!',60,'',10),(80,'<p>첫번째에피소드입니다</p>','2020-05-26 02:30:53.313000','1화. 첫번째에피소드',135,'',1),(81,'<p><strong>두번째에피소드입니다.</strong></p>','2020-05-26 07:00:25.868000','2화. 두번째에피소드',32,'',1),(83,'<p><em>세번째에피소드입니다.</em></p>','2020-05-26 07:43:14.240000','3화. 세번째에피소드',6,'',1),(84,'<p><u>네번째에피소드입니다.</u></p>','2020-05-26 07:43:44.496000','4화. 네번째에피소드',16,'',1),(104,'','2020-05-27 22:42:33.572000','',5,'5',20),(105,'<p>개츠비는 벌이다.......</p><p><br></p><p>에피소느는 웹소설을 스마트하게 쓸 수 있는 플랫폼이 될 것이다...</p><p><br></p>','2020-05-27 22:42:41.195000','',6,'',20),(106,'<p>여기 기나긴 세월을 버틴 돌멩이가 있다.</p>','2020-05-28 00:56:11.673000','세월의 돌(1)',5,'',4),(107,'<p>다섯번째에피소드</p>','2020-05-28 00:58:17.501000','5화. 다섯번째에피소드',1,'',1),(108,'<p>여섯번째에피소드</p>','2020-05-28 00:58:33.120000','6화. 여섯번째에피소드',1,'',1),(109,'<p>이 돌멩이는 자기보다 단단한 것은 없을 것이라고 생각했다.</p>','2020-05-28 00:58:45.329000','세월의 돌(2)',3,'',4),(110,'<p>일곱번째에피소드</p>','2020-05-28 00:59:03.752000','7화. 일곱번째에피소드',3,'',1),(111,'<p>여덟번째에피소드</p>','2020-05-28 00:59:23.988000','8화. 여덟번째에피소드',2,'',1),(112,'<p>아홉번째에피소드</p>','2020-05-28 00:59:38.014000','9화. 아홉번째에피소드',1,'',1),(113,'<p>열번째에피소드</p>','2020-05-28 00:59:49.572000','10화. 열번째에피소드',1,'',1),(115,'<p>열한번째에피소드</p>','2020-05-28 01:00:00.918000','11화. 열한번째에피소드',1,'',1),(116,'<p>열두번째에피소드</p>','2020-05-28 01:00:15.417000','12화. 열두번째에피소드',1,'',1),(117,'<p>열세번째에피소드</p>','2020-05-28 01:00:25.596000','13화. 열세번째에피소드',1,'',1),(118,'<p>열네번째에피소드</p>','2020-05-28 01:00:36.228000','14화. 열네번째에피소드',1,'',1),(119,'<p>열다섯번째에피소드</p>','2020-05-28 01:00:47.203000','15화. 열다섯번째에피소드',3,'',1),(129,'<p>\"저 팬이에요\"</p>','2020-06-03 04:46:05.239000','1화. ?',0,'',101),(137,'<p>주인공은 꿈속에서 싸피를 만납니다.</p><p>신비한 동화 속 세계로 안내할 싸피는... 상상 속의 인물입니다.</p><p>나이도, 성별도, 생김새도 알 수 없습니다.</p>','2020-06-08 06:40:33.669000','EP 1. 내 친구 싸피',0,'',133),(138,'<p>시린 겨울이 지나가고, 겨우내 맞이한 찬란한 봄이었다. 하지만 그것도 오늘로서는 끝을 맞이하게 되었다. 내딛는 발걸음은 천근만근 무거웠지만, 멈춰있을 수는 없는 노릇인지라 천천히 발을 옮겼다. 뺨을 따라 흘러내리는 눈물이 멈추지 않는 까닭은 그를 두고 떠나야만 하기 때문임을 알고 있다. 하지만, 그럼에도. 우리 둘의 인연은 기약 없는 약속으로 맺어져 있기 때문에. </p><p><br></p><p>\"다음 생에서는, 부디.\"</p><p><br></p><p>우리는 또다시 만날 것이며, 사랑을 할 수 있을 것이다.</p>','2020-06-08 07:37:07.445000','Prologue',0,'',135),(140,'<p>어느날 갑자기 좀비가 나타났다.</p><p>우리는 부산 국제 영화제에서 공연을 하고 있었고, 운이 좋게 살아남을 수 있었다.</p><p>\"리더... 우리 괜찮은거지...?\"</p><p>\"걱정마 우리가 누구야 우리 방탄이야!\"</p><p>갑자기 어디선가 들려오는 목소리</p>','2020-06-10 14:01:15.486000','좀비가 가득한 세상',0,'',151),(141,'<p>어느날 갑자기 좀비가 나타났다.</p><p>우리는 부산 국제 영화제에서 공연을 하고 있었고, 운이 좋게 살아남을 수 있었다.</p><p>\"리더... 우리 괜찮은거지...?\"</p><p>\"걱정마 우리가 누구야 우리 방탄이야!\"</p><p><span style=\"color: rgba(0, 0, 0, 0.6);\">갑자기 어디선가 들려오는</span> 목소리ㄹ</p><p>ㄹㅇㄹㅇㄹ</p>','2020-06-10 15:13:55.620000','좀비가 가득한 세상',0,'',151),(143,'<p>\"오빠 ... 나는 당연히 오빠가 나랑 결혼하는 줄 알았어...\"</p><p><br></p><p>\"하... 뭐...? ....\"</p><p>...</p><p>\"... 나 먼저 일어날게.\"</p><p><br></p><p>.......</p><p><br></p>','2020-06-15 02:04:18.689000','0화. 프롤로그',0,'',17),(144,'<p>6월 중순 종강이 얼마 안남았다.</p><p>이번 학기는 코로나때문에 종강이 평소보다 늦다.</p><p><br></p><p><br></p>','2020-06-15 02:54:00.545000','1화. 6월 중순',0,'',18),(145,'<p>사실 이 소설의 캐릭터 설정의 아이유사진은 움직이는 움짤이다.</p><p>나만 볼 수 있다 꺄하ㅏㅏㅏ하ㅏ 너무 예쁘다 ㅠ 주접 대박</p><p><br></p><p>ㅋㅋㅋ</p>','2020-06-15 02:55:38.404000','2화. 사실',0,'',18),(146,'<p>트와이스는 나연, 정연, 모모, 사나, 지효, 미나, 다현, 채영, 쯔위로 이루어진 9명의 그룹으로 아이돌 볼링 대회에 대표로 내보낼 선수를 뽑아야 한다.</p><p>지금 사나가 공을 집었다.</p>','2020-06-15 04:17:04.675000','볼링 대회 대표 뽑기',0,'',2077),(147,'<p>어쩌다가.. ?</p>','2020-06-15 04:22:38.461000','1화. 어쩌다가',0,'',2078),(148,'<p>?</p>','2020-06-15 04:23:43.397000'