INSERT INTO `novel` VALUES (1,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/2_1592183037749.jpg','궁금하지? 방탄의 의사생활',0,1,'슬기로운 방탄생활',1,1,0,0,'2020-05-28 01:00:57.916000',371,2),(4,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/1_1590732083630.jpg','한국 판타지계의 빛나는 별 전민희 작가의 데뷔작 <세월의 돌>평범한 잡화점 점원 파비안은 뜻밖의 사고로 모든 것을 잃고 긴 여행을 떠나게 된다. 비밀을 감춘 은빛 머리의 미소녀 유리카와 함께 떠나는 여정에는 상상도 못할 일들이 기다리고 있는데……. 전민희 작가의 데뷔작이자. <태양의 탑> 시리즈와 함께 <아룬드 연대기>의 큰 축을 이루는 대작!',0,1,'세월의 돌',1,1,0,0,'2020-06-10 18:39:14.848000',1,1),(5,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/2_1591390258164.jpg','흑수저 판타지 장편소설',0,1,'회기자 사용설명서',1,1,0,-1,'2020-05-22 03:52:07.685000',0,2),(6,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/2_1591390168176.jpg','복수를 위해 유물과 계약하고 과거로 돌아오다',0,1,'도굴왕1',1,1,0,-1,'2020-05-22 03:53:27.729000',0,2),(8,'https://dn-img-page.kakao.com/download/resource?kid=p2mNB/hyqE7Zo0tZ/CiMqWfluwP78F14ZlfvoR1','의문의 사망 이후 소설 속으로 빙의하게 된 박은하. 하지만 신은 아주 간단하게 그녀에게 빅엿을 주고 떠났으니,\"단명할 상이네.”그녀가 빙의한 인물은 조만간 행복한 금수저인 채로 단명할 엑스트라였다.약혼남에게 독살당할 운명을 지닌 레리아나 맥밀런, 그녀가 단명을 피하기 위해 악마보다 더한 놈과의 거래를 시작한다.“거래를 청하고 싶습니다.”“말을 맞춰 주었더니, 재미없는 장난이었군.”살기 위한 엑스트라 빙의녀와 요사스러운 소설 속 남자 주인공의 은밀한 비즈니스!‘이것 봐! 내 몸에 마그네슘이 부족한 것 같은데?’―과즙 같은 상큼함을 지닌, 레리아나 맥밀런.‘지금 네 입에서 나오는 게 말인지 똥인지 모르겠는데?’―속을 알 수 없는 이중인격자, 노아 윈나이트.유쾌하고 은밀한 두 남녀의 밀고 당기는 목숨 연장 프로젝트!일러스트 ⓒ 솔',0,1,'그녀가 공작저로 가야 했던 사정',1,1,0,0,'2020-05-29 06:01:14.072000',0,4),(9,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/2_1591390124330.jpg','위기에 빠진 사람을 구하기 위해서 그야말로 물불 안가리는 주인공. 각성한 특수능력을 구조 활동에 활용하며 사람들을 구해주는 가슴뜨거운 영웅담!',0,1,'레스큐시스템',1,1,0,-1,'2020-05-22 04:33:37.960000',0,2),(10,'https://dn-img-page.kakao.com/download/resource?kid=dovU2I/hyxJEblww2/1kBaJWk0k5rsnhtEJWGkI0','슬럼프에 빠진 소설작가가 주인공에 빙의? 소설 속 등장할 주인공들에게 무참하게 당하지 않으려면 수하를 늘려야 한다. 짠한 고생담 그리고 약빤 필체!',0,1,'던전짓는 플레이어',1,1,0,-1,'2020-05-27 09:09:10.113000',3,4),(11,'https://comicthumb-phinf.pstatic.net/20200128_116/pocket_1580191213840dJuL1_JPEG/__.jpg','미친 달의 세계에 온 것