조 보이 그룹이다.',0,1,'BTS',1,1,0,0,'2020-06-08 04:27:18.192000',0,8),(128,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/8_1591592493669.jpg','EXO는 SM 엔터테인먼트 소속의 대한민국 9인조 보이 그룹이다.',0,1,'EXO',1,1,0,0,'2020-06-08 05:01:34.239000',0,8),(129,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/8_1591593825169.jpg','세븐틴(SEVENTEEN)은 2015년 5월 26일날 데뷔한 대한민국의 13인조 보이 그룹으로, 플레디스 엔터테인먼트 소속이다. 그룹 내에는 퍼포먼스, 보컬, 힙합팀이 존재한다. 세븐틴의 뜻은 팀 인원 13+유닛 팀 +3 우리는 하나라는 뜻인 +1로, 13+3+1=17 이란 뜻이다.',0,1,'세븐틴',1,1,0,0,'2020-06-08 05:23:45.747000',0,8),(130,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/8_1591596910177.jpg','레드벨벳(Red Velvet)은 SM 엔터테인먼트 소속의 대한민국 5인조 걸 그룹이다. 팀명은 강렬하고 매혹적인 컬러 Red와 부드러운 느낌의 Velvet에서 연상되는 감각적인 이미지처럼, 색깔 있고 세련된 음악과 퍼포먼스로 선보이겠다는 포부를 담고 있다.',0,1,'레드벨벳',1,1,0,0,'2020-06-08 06:15:10.774000',0,8),(131,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/8_1591597556792.jpg','강다니엘(姜다니엘, 1996년 12월 10일 ~ )은 대한민국의 가수로, 대한민국의 보이 그룹 워너원의 멤버 및 센터였다.[1] 2017년 Mnet에서 방영한 《프로듀스 101 시즌2》을 통해 그룹 워너원으로 2017년 8월 7일에 데뷔하였다. 2019년 1월 24일부터 1월 27일까지 고척스카이돔에서 열린 콘서트, <2019 Wanna One Concert [Therefore]>을 끝으로 워너원의 활동을 마무리 지었다. 이후 1인 기획사인 커넥트 엔터테인먼트를 설립하며 솔로 가수로서 활동을 이어나가고 있다. 공식 팬클럽명은 ‘DANITY (다니티)’이다. 강다니엘은 보이 그룹 개인 브랜드평판 13개월 연속 1위 기록을 소유하고 있다. ',0,1,'강다니엘',1,1,0,0,'2020-06-08 06:25:57.384000',0,8),(132,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/8_1591598043883.jpg','2012년에 제작하고, 2013년에 개봉한 대한민국의 영화. 소장르는 범죄, 액션, 드라마.\n\n최민식, 황정민, 박성웅, 이정재가 주연을 맡은 갱스터 느와르 영화이다. 2012년 6월 16일부터 2012년 9월 14일까지 촬영했다. 이듬해 초에 바로 개봉했다. 영화 부당거래와 악마를 보았다의 시나리오(각본)를 담당하면서 충무로의 스타 작가로 떠오른 박훈정이 혈투이후로 두번째로 메가폰을 잡았다. 사나이픽처스의 창립작.',0,1,'신세계',1,1,0,0,'2020-06-08 06:34:04.480000',0,8),(133,'https://i.imgur.com/37mPPf6.png','상상 속의 인물 싸피와 친구가 되어 모험을 떠나는 소년의 이야기',0,1,'싸피와 함께',1,1,0,0,'2020-06-08 06:40:33.669000',0,9),(134,'https://episode-image.s3.ap-northeast-2.amazonaws.com/novel/8_1591598868940.jpg','《도깨비》는 2016년 12월 2일부터 2017년 1월 21일까지 방영되었던 tvN 금토드라마이다.\n\n이 드라마는 도깨비 설